  false,\n\t\"url\": null,\n\t\"notes\": \"This vector shapefile is one of two layers
  that depict the extent of the 2003 digital orthophoto mosaic for the coastal and
  nearshore areas of Bering Land Bridge National Preserve (BELA), Cape Krusenstern
  National Monument (CAKR), and nearby portions of northwestern Alaska. The extent
  polygons are attributed with photo source (NOAA or NPS) and acquisition date. The
  orthophoto mosaic was created by Aero-Metric from 1:24,000-scale, natural-color
  aerial photographs acquired for NPS on July 19, 2003, and for NOAA on September
  14-24, 2003. Other imagery available in this series includes orthorectified aerial
  photography for approximately 1950 and 1980. All data is available through an unrestricted
  public license, and can be obtained on a hard drive by request (see Distributor
  contact information below). The imagery will be of interest to land managers, scientists,
  and others for observation and analysis of natural features and ecosystems.\",\n\t\"license_title\":
